tables.table_schema:
CREATE TABLE weather_data (
  id INT PRIMARY KEY,
  city VARCHAR(50),
  date DATE,
  temperature FLOAT
);

CREATE TABLE historical_weather_data (
    city VARCHAR,
    date DATE,
    temperature FLOAT,
    humidity FLOAT
);

CREATE TABLE weather_data (
  city VARCHAR,
  date DATE,
  temperature FLOAT,
  precipitation FLOAT
);

CREATE TABLE temperature_data (
  city VARCHAR,
  date DATE,
  max_temperature FLOAT,
  min_temperature FLOAT
);

CREATE TABLE precipitation_data (
  city VARCHAR,
  date DATE,
  rainfall FLOAT,
  snowfall FLOAT
);

CREATE TABLE weather_analysis (
  city VARCHAR,
  date DATE,
  avg_temperature FLOAT,
  avg_precipitation FLOAT
);

CREATE TABLE city_data (
    id INT PRIMARY KEY,
    city_id INT,
    city_name VARCHAR(255),
    country_code CHAR(2)
);

CREATE TABLE humidity_data (
    id INT PRIMARY KEY,
    date DATE,
    city_id INT,
    humidity FLOAT
);
